import './App.css';
import {useEffect} from 'react';

function App() {

  const dictionaryApi = async() => {
    try {
      const data=await axios.get('https://api.dictionaryapi.dev/api/v2/entries/en/king');
      console.log(data);
    } catch (error) {
      console.log(error);      
    }
  };
  useEffect(() => {
    dictionaryApi();
  }, []);


  return (
    <div className="App">
      Hello world
    </div>
  );
}

export default App;
